import React from "react";
import '../styles/cancion.css'


function Canciones(){
    return(
        <>
        <body className="bodiii">
            <div class="song-container">
        <img class="song-image" src="cancion.jpg" alt="Nombre de la canción"/>
        <div class="song-details">
            <div class="song-title">Nombre de la Canción</div>
            <div class="song-artist">Artista</div>
            <button class="like-button">Me gusta</button>
        </div>
    </div>
    </body>
        </>
    )
}

export default Canciones;
